  false,\n\t\"url\": null,\n\t\"notes\": \"The Clarence Cannon National Wildlife Refuge
  Water Management Plan has been developed to meet the station objectives. The purpose
  of this plan is to establish a schedule of operations for the manipulation of managed
  waters. Each water unit's management is covered. Topics include, flowline elevation,
  elevation of pool bottom, surface elevations, water supply, biological conditions
  and wildlife use, and objective for proposed levels. This plan describe water management
  for Clarence Cannon National Wildlife Refuge in 1988.\",\n\t\"license_title\": \"License
